import React from "react";
import "./Numbox.css";

const Numbox = ({ number, type }) => {
  let boxtype = type === "circle" ? "numbox-circle" : "numbox";
  return (
    <div className={boxtype}>
      <span>{number}</span>
    </div>
  );
};

export default Numbox;
